«Имеют результаты» – показывает только те расчетные варианты и
«Мультивариант», у которых есть результаты;
«Не пустой» – если помимо данного фильтра были применены фильтры по
типу объекта, в дереве навигации будут выведены только элементы выбранного
типа, которые имеют объекты на дочернем уровне, или объекты контейнеры
(например, «С|Тип»), которые содержат соответствующие объекты (например,
«Субмодель»), в ином случае – в дереве навигации будут выведены все объекты
выбранного типа;
«К|Субмодель» – показывает только объекты типа «К|Субмодель»;
«Вики-страница» – показывает только объекты типа «Вики-страница»;
«Задание» – показывает только объекты типа «Задание»;
«Эксперимент» – показывает только объекты типа «Эксперимент»;
«Субмодель» – показывает только объекты типа «Субмодель»;
«Документ» – показывает только объекты типа «Документ»;
«Деталь» – показывает только объекты типа «Деталь»;
«Проект» – показывает только объекты типа «Проект»;
«Цифровой макет» – показывает только объекты типа «Цифровой макет»;
«Сториборд» – показывает только объекты типа «Сториборд»;
«Папка» – показывает только объекты типа «Папка»;
«Мультивариант» – показывает только объекты типа «Мультивариант»;
«С|Тип» – показывает только объекты типа «С|Тип»;
«График» – показывает только объекты типа «График»;
«Дашборд» – показывает только объекты типа «Дашборд»;
«Группа экспериментов» – показывает только объекты типа «Группа
экспериментов».
Все фильтры как внутри одного типа, так и принадлежащие разным типам
могут применяться одновременно.
Для сброса всех фильтров одновременно следует нажать кнопку «Сбросить
все».
